    def buttonAction(self, event, i):
        for num in range(len(self.arrayWidgetButtons)):
            palette = self.arrayWidgetButtons[num].palette()
            if (num == i):
                palette.setColor(self.arrayWidgetButtons[num].backgroundRole(), QtGui.QColor(156, 195, 245))
            else:
                palette.setColor(self.arrayWidgetButtons[num].backgroundRole(), QtGui.QColor(113, 118, 126))
            self.arrayWidgetButtons[num].setPalette(palette)
            self.stackedPanels.setCurrentIndex(i)

    def topBtnAction(self, i):
        self.stackedMenus.removeWidget(self.widgetUsed)
        self.stackedMenus.hide()
        self.stackedMenus.addWidget(self.arraySubmenu[i])
        self.stackedMenus.show()
        self.widgetUsed = self.arraySubmenu[i]

    def btnFunctionality(self, MainWindow):
        self.btn_crearArchivo.clicked.connect(self.btn_crearArchivoEvent)
        self.btn_chooseDirectory.clicked.connect(lambda: self.btn_chooseDirectoryEvent(MainWindow))
    def btn_crearArchivoEvent(self):
        file = self.txrEdit_fileName.text()
        print(file)
    def btn_chooseDirectoryEvent(self, MainWindow):
        fname = QtWidgets.QFileDialog.getOpenFileName(MainWindow, "OpenFile", "./registros", "All files (*);;dja")
        self.lineEdit.setText(fname[0])

    def reloadFileChooser(self):
        list = listDirectories("./images")

        for i in list:
            self.cB_fileOptions.addItem(i)



